import React from 'react';
import Header from '../Header';
import { connect } from 'react-redux';
import Intro from '../Intro';
import Background from '../Background';
import DSN from '../DSN';
import Solution from '../Solution';
import Footer from '../Footer';

function App({app}) {
    console.log(app)
    switch (app) {
        case 1: 
            return (
                <div className="App">
                    <Header/>
                    <Background/>
                    <DSN
                    text={'ACTIVIDAD 1'} />
                    <Solution/>
                    <Footer/>
                </div>
            )
        case 2: 
            return (
                <div className="App">
                    <Header/>
                    <Background/>
                    <DSN/>
                    <Solution/>
                    <Footer/>
                </div>
            )
        case 3: 
            return (
                <div className="App">
                    <Header/>
                    <Intro/>
                    <Background/>
                    <DSN/>
                    <Solution/>
                    <Footer/>
                </div>
            )
        default:
            return (
                <div className="App">
                    <Header/>
                    <Intro/>
                    <Footer/>
                </div>
            )
    };
}

export default connect(
    state => ({
        app: state.state
    }),
    undefined
)(App);
